import React from 'react';
import {useSpring, animated} from 'react-spring'
import logo from './logo.png'
import {Link} from "react-router-dom";

function App() {
    const props = useSpring({
        opacity: 5,
        from: {opacity:0},
        config:{mass:30, tension:1, friction: 150},
        from: {color: 'red'},
        enter: {color: 'gold'},
        leave: { color: 'green' },
    })
    return  ( 
        <div>
             <animated.img className="btn"src={logo} style={props}>
        </animated.img>
        <animated.div style={props} className="viewpoint-header">
                    <Link className="viewpoint-header2" to="./about"> about     +</Link>
                        <Link className="viewpoint-header2" to="./portfolio">portfolio     +</Link>

                        <Link className="viewpoint-header2" to="./products">  shop </Link>
                </animated.div>
        </div>
    )

}

export default App;
